import React from "react";

const DIsplayItem = ({ ticket }) => {
  const getdigits = (num) => {
    let li = [];
    let temp = num;
    while (temp > 0) {
      li = [temp % 10, ...li];
      temp = Math.floor(temp / 10);
    }
    console.log(li);
  };
  getdigits(ticket);

  return (
    <div>
      <p className="dispTicket">{ticket}</p>
    </div>
  );
};
export default DIsplayItem;
